  clone(): Arduino {
    const cloned = new Arduino(this.position);
    cloned.id = this.id;
    cloned.rotation = this.rotation;
    cloned.properties = { ...this.properties };
    return cloned;
  }

  validateProperties(): boolean {
    const props = this.properties as ArduinoProperties;
    const validModels = ['Uno', 'Nano', 'Mega', 'Leonardo'];
    const validVoltages = [3.3, 5, 7, 9, 12];

    return (
      validModels.includes(props.model) && validVoltages.includes(props.voltage)
    );
  }

  // Ð”Ð¾Ð¿Ð¾Ð»Ð½Ð¸Ñ‚ÐµÐ»ÑŒÐ½Ñ‹Ðµ Ð¼ÐµÑ‚Ð¾Ð´Ñ‹ Ð´Ð»Ñ Arduino
  getDigitalPins(): string[] {
    return Array.from({ length: 14 }, (_, i) => `D${i}`);
  }

  getAnalogPins(): string[] {
    return Array.from({ length: 6 }, (_, i) => `A${i}`);
  }

  getPowerPins(): string[] {
    return ['5V', '3.3V', 'GND1', 'GND2'];
  }

  getAllPins(): string[] {
    return [
      ...this.getDigitalPins(),
      ...this.getAnalogPins(),
      ...this.getPowerPins(),
    ];
  }
